@lru_cache(maxsize=None)
def _get_font_bytes(style: str) -> Optional[bytes]:
    parts = LM_ROMAN_COMPRESSED.get(style)
    if not parts:
        return None
    compressed = ''.join(parts)
    return zlib.decompress(base64.b64decode(compressed))


@lru_cache(maxsize=None)
def get_lmroman_data_uri(style: str) -> Optional[str]:
    font_bytes = _get_font_bytes(style)
    if font_bytes is None:
        return None
    return 'data:font/otf;base64,' + base64.b64encode(font_bytes).decode('ascii')
